console.log("Starting program...");

var numWords = 109561;

//const numWords = words.length;
const alphabet = ['a', 'b', 'c', 'd', 'e', 'f', 'g', 'h', 'i', 'j',
            'k', 'l', 'm', 'n', 'o', 'p', 'q', 'r', 's', 't',
            'u', 'v', 'w', 'x', 'y', 'z'];
            
const gameCounts = Array(26).fill(0);


var submit = document.querySelector("Submit");

submit.onclick = mainLoop();

function mainLoop(wordsList)
{
  console.log("Starting mainLoop...");
   
let inputField = document.getElementById("userWord"); 
var theWord = inputField.value;
theWord = theWord.toLowerCase();
//console.log("theWord = ", theWord);

var wordsList = new Array();
readWordsList(wordsList);

for (let i = 0; i < theWord.length; i++) {
  const ltr = theWord[i];
  const ndx = alphabet.indexOf(ltr);
  gameCounts[ndx]++;
  }

  let numFound = 0;

  for (let i = 1; i <= numWords; i++) {
      let in_theWord = true;
      var dictWord = wordsList[i];   
              
      if (dictWord.length > theWord.length) {
          in_theWord = false;
      } else {
          const dictCounts = Array(26).fill(0);
          for (let j = 0; j < dictWord.length; j++) {
              const ltr = dictWord[j];
              const ndx = alphabet.indexOf(ltr);
              dictCounts[ndx]++;
          }
        
          let included = true;
          for (let k = 0; k < 26; k++) {
              if (dictCounts[k] > gameCounts[k]) {
                  included = false;
              }
          }
          if (included && dictWord.length >= 4) {
              numFound++;
              if (numFound == 1) {   
                var headerString = "Words with 4 or more letters in: " + theWord;
                document.write("<p style='font-size:x-large;'</p>",headerString);
                //document.write("<br>");
              }
              document.write("<p style='font-size:x-large;'</p>",dictWord);
              //document.write("<br>");
              //console.log("Found dictWord = ", dictWord);
              
        
          }
      }
  }

} /* End of function mainLoop */


